        "mantananiIsland":
            MessageLookupByLibrary.simpleMessage("Isla Mantanani"),
        "mantananiIslandContent": MessageLookupByLibrary.simpleMessage(
            "Cerca de Kota Belud en Sabah, la isla Mantanani ofrece algunos de los mejores lugares de buceo en Borneo. Los buceadores y snorkelistas acuden a nadar con caballitos de mar y rayas en excursiones de un día desde la capital. Las personas con certificación de buceo pueden bucear en más de 20 ubicaciones, incluidas tres embarcaciones hundidas. Después de unas horas en el Mar de China Meridional, relájate con la famosa puesta de sol de Borneo en las playas de arena blanca prístina."),
