        "mossyForest": MessageLookupByLibrary.simpleMessage(
            "Bosque Musgoso, Tierras Altas de Cameron"),
        "mossyForestContent": MessageLookupByLibrary.simpleMessage(
            "El bosque musgoso es un ecosistema natural que solo crece a mayores altitudes en las Tierras Altas de Cameron y otras cordilleras de Malasia. Nubes bajas en el cielo, impulsadas por el viento, cubren los árboles con niebla y humedad persistentes, proporcionando un biotopo perfecto para musgos, helechos, líquenes y orquídeas. Este bosque tropical húmedo y perenne también sirve de refugio para una variedad de especies montanas, incluyendo mariposas, roedores, ranas, aves y mamíferos presentes solo en este clima frío."),
        "mountPulai":
            MessageLookupByLibrary.simpleMessage("Monte Pulai, Johor"),
        "mountPulaiContent": MessageLookupByLibrary.simpleMessage(
            "El Monte Pulai es una montaña de 654 metros en Johor, Península de Malasia. Debido a su proximidad y facilidad de acceso, es un destino popular de senderismo para los singapurenses y locales. La cima del Monte Pulai no está abierta al público, ya que está asegurada por el ejército y alberga dos torres de comunicación. El Monte Pulai es un sendero circular moderadamente transitado de 14,3 kilómetros cerca de Kulai, Johor, Malasia, con una cascada y una calificación de dificultad. El sendero también se utiliza para acampar, ciclismo, correr y paseos por la naturaleza."),
        "mrtDescription": MessageLookupByLibrary.simpleMessage(
            "El Tránsito Rápido Masivo (MRT) está dividido en dos líneas; la primera es la línea Sungai Buloh-Kajang que tiene 51 km de longitud con 31 estaciones a lo largo de su ruta. Todas las estaciones comienzan a operar a las 6:00 am diariamente. Los horarios de cierre varían según las estaciones. Un viaje sencillo cuesta a partir de RM1.20. Línea de ayuda: 1800-82-6868"),
