        "nasiLemakDescription": MessageLookupByLibrary.simpleMessage(
            "El Nasi Lemak es un arroz fragante cocinado tradicionalmente en leche de coco y hojas de pandan, servido con sambal picante, pepinos, anchoas fritas, huevo y cacahuetes fritos. Se combina mejor con un vaso de teh tarik caliente. La mayoría de las tiendas o puestos ofrecen opciones adicionales como pollo o ternera rendang, pollo frito, sambal de gambas y mucho más."),
        "nationalArtGallery":
            MessageLookupByLibrary.simpleMessage("Galería Nacional de Arte"),
