        "nationalMuseumDescription": MessageLookupByLibrary.simpleMessage(
            "Para entender más sobre la historia y la cultura de Malasia y ver réplicas de casas malayas, escenas de bodas y exposiciones de caza. También se exhibirán instrumentos locales y trajes nacionales. Además de las exposiciones permanentes en el museo, también hay exposiciones temporales que rotan durante el año y se sitúan en el Salón Central."),
