        "nightOutDescription": MessageLookupByLibrary.simpleMessage(
            "Kuala Lumpur es una ciudad vibrante con una increíble escena de vida nocturna. Dirígete a Bangsar o Changkat Bukit Bintang para experimentar la vida nocturna de KL. Estos lugares tienen una variedad de bares para elegir, con sus propios bares de cócteles y DJ tocando música toda la noche. Con sus restaurantes únicos, bares de moda, discotecas y lugares de karaoke geniales, hay algo para todos."),
