        "ourCompanyDescription": MessageLookupByLibrary.simpleMessage(
            "KL La Guía es una guía trimestral, publicada por primera vez en agosto de 2007. Somos una guía de viajes gratuita que ayuda a los viajeros a planificar su viaje por la capital de Malasia, Kuala Lumpur. KL La Guía incluye consejos de viaje, lugares para explorar, sitios para niños, hoteles y mucho más. Con KL La Guía, navegar por la ciudad se vuelve más fácil."),
