        "pangkorIsland": MessageLookupByLibrary.simpleMessage("Isla Pangkor"),
        "pangkorIslandContent": MessageLookupByLibrary.simpleMessage(
            "Visita la Isla Pangkor si buscas un lugar sin turistas. Ubicada cerca de la costa de Perak, la isla cuenta con playas desiertas, agua limpia y una densa jungla que domina el centro. Los visitantes aprecian tener la oportunidad de tomar el sol bajo las palmeras sin nadie más a la vista. También visita el fuerte colonial holandés y toma fotos de un muelle de madera tradicional."),
        "panoramaHill": MessageLookupByLibrary.simpleMessage(
            "Colina Panorama, Sungai Lembing"),
        "panoramaHillContent": MessageLookupByLibrary.simpleMessage(
            "La Colina Panorama es una colina en Sungai Lembing, 45 kilómetros al noroeste de Kuantan. Con una altura de 271 metros, solo hay un camino hacia la cima. Comience desde la parte inferior de la escalera y avance hacia arriba. La característica principal del sendero es una escalera con barandillas; solo unos pocos tramos cortos están sin la escalera. Cuando llegue a la cima de la colina, podrá ver una vista panorámica de la ciudad circundante. Al visitante le suele llevar entre 30 y 45 minutos subir la Colina Panorama."),
        "parks": MessageLookupByLibrary.simpleMessage("Café"),
        "penangNationalPark": MessageLookupByLibrary.simpleMessage(
            "Parque Nacional de Penang, Penang"),
        "penangNationalParkContent": MessageLookupByLibrary.simpleMessage(
            "Este es el parque nacional más pequeño de Malasia, con 23 kilómetros cuadrados, pero sus bosques bordeados de playas albergan monos de hoja plateada, lémures voladores, gatos leopardo y una gran cantidad de lagartos, anfibios y reptiles. Actividades como caminatas en la selva y paseos en bote a playas tranquilas de arena dorada llenarán cómodamente el día. Hay dos senderos principales en el parque: uno que recorre la costa hacia la Playa de los Monos, y otro que atraviesa colinas y selva hasta playas más aisladas, donde se encuentra el Santuario de Tortugas."),
