        "pulauLangkawi":
            MessageLookupByLibrary.simpleMessage("Isla Pulau Langkawi"),
        "pulauLangkawiContent": MessageLookupByLibrary.simpleMessage(
            "La isla de Langkawi alberga algunas de las mejores playas de Malasia Peninsular. La isla combina montañas y manglares con costas resplandecientes. Realiza una excursión a Pulau Dayang Bunting, declarada por la UNESCO, alimenta a las águilas y observa a los monos nadar en busca de comida. O lleva tu toalla y toma el sol en Pantai Cenang antes de beber en un bar frente a la playa. Otra ventaja es que esta isla es libre de impuestos, ¡no dudes en liberar a tu comprador interno cuando estés allí!"),
        "pulauRedang":
            MessageLookupByLibrary.simpleMessage("Isla Pulau Redang"),
        "pulauRedangContent": MessageLookupByLibrary.simpleMessage(
            "Una de las islas más grandes de la costa este de Malasia, Pulau Redang es famosa por sus aguas cristalinas y playas de arena blanca. Es una de las nueve islas que forman un parque santuario marino que ofrece a los turistas la oportunidad de hacer snorkel y buceo. La playa está llena de arena blanca suave. Puedes ver corales y peces a solo unos metros de la playa."),
        "rapidKLBusDescription": MessageLookupByLibrary.simpleMessage(
            "El Autobús RapidKL es comúnmente visto en la mayoría de las estaciones de tren y generalmente actúa como un medio de transporte basado en el tránsito para llevar a los pasajeros directamente a sus destinos preferidos. Cada viaje en el autobús puede costar hasta RM5.00 por viaje, que se puede pagar con cambio exacto o utilizando la tarjeta Touch n Go al entrar y salir. Línea de ayuda: 03-7885 2585"),
