        "sevenWellsContent": MessageLookupByLibrary.simpleMessage(
            "La cascada de Siete Pozos, también conocida como Jalan Telaga Tujuh, está situada a unos 20 minutos a pie del famoso puente Langkawi Sky Bridge y es una de las atracciones naturales más impresionantes de la isla. La cascada cae desde el monte Mat Cincang, el segundo pico más alto de Langkawi, y es un lugar popular para turistas y locales. La caída vertical completa mide 91 metros de altura, aunque solo se puede ver una pequeña sección desde la base. Según la leyenda, esta cascada es hogar de hadas y el agua tiene propiedades calmantes. La cascada parece mágica porque está rodeada de naturaleza, con rica flora y fauna."),
