        "sungaiLembing":
            MessageLookupByLibrary.simpleMessage("Sungai Lembing, Pahang"),
        "sungaiLembingContent": MessageLookupByLibrary.simpleMessage(
            "Malasia está bendecida con una abundancia de selvas tropicales que albergan impresionantes cascadas. La cascada Arcoíris se encuentra a 45 kilómetros al noroeste de Kuantan, en la península de Malasia, en el pueblo de Sungai Lembing. Cada mañana, entre las 9 y las 10 a.m., el sol se encuentra con el agua que cae en la base de la cascada, formando un impresionante arcoíris. Gente de todo el mundo viaja una hora y media hasta la cascada solo para contemplar la belleza de la naturaleza. La cascada Arcoíris es una gran cascada escondida en el área de selva de Sungai Lembing, accesible en vehículo 4WD y caminata."),
        "sungaiPisangContent": MessageLookupByLibrary.simpleMessage(
            "La cascada Pisang es un sendero de ida y vuelta de 3,1 kilómetros con una cascada cerca de Gombak, Selangor, Malasia. Es adecuado para excursionistas de todos los niveles. El sendero está abierto todo el año y es frecuentemente utilizado para acampar, montar en bicicleta y observar aves. Cerca de la parte superior de la cascada, hay algunos lugares ideales para picnic y acampada. Es una caminata de ocio que requiere cruzar una cascada, prepárate para mojarte los zapatos."),
